// src/pages/NeoWs.js
import React, { useEffect, useState } from 'react';
import Navbar from '../components/Navbar'; // Ensure the path is correct
import MyNEOChart from '../components/MyNEOChart'; // Import the chart component
import './NeoWs.css'; // Import styles

function NeoWs() {
  const [neoData, setNeoData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch NEO data from the backend
  const fetchNEOData = async () => {
    setLoading(true);
    try {
      const response = await fetch('/api/neo'); // Fetch data from the backend
      const data = await response.json();
      setNeoData(data); // Set the NEO data for visualization
    } catch (error) {
      console.error('Error fetching NEO data:', error);
      setError('Failed to fetch NEO data');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchNEOData(); // Fetch data when the component mounts
  }, []);

  return (
    <div className="neo-container">
      <Navbar /> {/* Include Navbar */}

      <div className="neo-content">
        <h1>Near-Earth Objects (NEO)</h1>
        {loading && <p>Loading...</p>}
        {error && <p className="error">{error}</p>}

        {/* Render the chart only when data is available */}
        {neoData.length > 0 && <MyNEOChart neoData={neoData} />}
      </div>
    </div>
  );
}

export default NeoWs;
